import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

const d= new Date().toLocaleDateString();
const t= new Date().toLocaleTimeString();
const img1="pk.jpg";
ReactDOM.render(
    <div>
    <h1 className="heading" >Hello, my name is prashant kumar</h1>
      <p>current date={d}</p>
      <img src={img1} alt="personimage" />
      <p>current time= {t} </p>
    </div>,
    document.getElementById('root')
);
